import './startSessionButton.css'

export default function StartSessionButton() {

    const [width, setWidth] = useState("startSessionButton1")

    let changeButton = () => {
        if(width === "startSessionButton"){
            setWidth("startSessionButton1")
        } else {
            setWidth("startSessionButton")
        }
    }

    return (
        <>
            <div className={width} onCLick={changeButton}>
                    <p>Start Session</p>
            </div>
        </>
    )
}
